import { useEffect } from "react";

const Home = () => {
    useEffect(()=>{
        fetch('http://localhost:8000/data').then(
            (response) => {
                return response.json()
            }
        ).then((data)=>{
            console.log(data);
        })
    },[])
    return(
        <div>
            <h1>Mailbox</h1>
    
        </div>
    )
}

export default Home;
